import logo from './logo.svg';
import search from './SURSE/search.png';
import account from './SURSE/account.png'
import cart from './SURSE/cart.png'
import menu from './SURSE/menu.png'
import './App.css';

function Header() {
  return (
    <header className="w-[100vw] h-[130px] fixed flex">
    <div className="logo w-[600px] h-full flex items-center sm:justify-center sm:ml-0 ml-[10px] cursor-default">
      <h1 className="font-italianno sm:text-[3.5vw] text-[36px]">GUESS Elite</h1>
    </div>

    <div className="taburi hidden sm:flex items-center w-full text-[#535353]">
      <a href="" className="ml-[5vw] xl:text-[32px] text-[16px] cursor-pointer hover:scale-110 transition xl:ml-[150px]">Acasa</a>
      <a href="" className="ml-[5vw] xl:text-[32px] text-[16px] cursor-pointer hover:scale-110 transition xl:ml-[150px]">Produse</a>
      <a href="" className="ml-[5vw] xl:text-[32px] text-[16px] cursor-pointer hover:scale-110 transition xl:ml-[150px]">Politica</a>
      <a href="" className="ml-[5vw] xl:text-[32px] text-[16px] cursor-pointer hover:scale-110 transition xl:ml-[150px]">Contact</a>
    </div>

    <div className="icons w-[250px] h-full ml-auto flex items-center justify-center">
    <a href="">
        <img 
          src={search} 
          alt="Search" 
          className="md:w-[25px] w-[15px] md:h-[25px] h-[15px] mr-2.5 hidden sm:block" 
        />
      </a>
      <a href="">
        <img 
          src={account} 
          alt="Account" 
          className="md:w-[25px] w-[15px] md:h-[25px] h-[15px] mr-2.5 hidden sm:block" 
        />
      </a>
      <a href="">
        <img 
          src={cart} 
          alt="Cart" 
          className="md:w-[25px] w-[15px] md:h-[25px] h-[15px] hidden sm:block" 
        />
      </a>
      <a href="">
        <img 
          src={menu} 
          alt="Menu" 
          className="h-[50px] w-[50px] sm:hidden" 
        />
      </a>
    </div>
  </header>
  );
}

function caca()
{
  return(
    <p>caca</p>
  );
}
export default {Header, caca};
